import Tarefas from "./Tarefas";
import ButtonAddTarefa from "./ButtonAddTarefa";

let arr = ['Ler bíblia', 'orar', 'jejuar', 'trabalhar']

function show(){
  return arr.forEach(item => {<Tarefas objetivo={item}/>})
}

const TodoList = () =>{
  return (
    <di>
      <ul>
        {show}
      </ul>
      <ButtonAddTarefa />
    </di>
  )
}

export default TodoList;
